  false,\n\t\"url\": null,\n\t\"notes\": \"Water levels and water quality parameters
  recorded on Crane Creek are described in this report. Water-Data Report 2013 413721083124001
  Pool 2B at Ottawa NWR LOCATION: Lat. 41u00b037'21.08\"N, long 83u00b012'38.44\"W,
  near Oak Harbor, OH. Ottawa County, OH on in management unit Pool 2B at Ottawa National
  Wildlife Refuge. Maximum Surface Area: 97 acres SURFACE WATER RECORDSPERIOD OF RECORD:
  June 2009 to present GAGE SITE: Design Analysis 522+, in a square metal gage house,
  in communication with in situ Esterline pressure transducer, YSI water quality sonde
  (6920) and AccQcomm interface module. GOES antenna in communication with DA 522+
  DCP transmits every hour in a 10 second window at a baud rate of 300. AccQcomm interface
  module in communication with Teledyne RD Instruments vertical acoustic doppler.
  Instruments are powered by two 1.2 ampere solar panels run to 2 deep cycle marine
  battery through 2 Sunsaver power regulators. Solar panels, GPS and GOES antennas
  are attached to two masts, connected to the gage house. Datum of gage is in the
  International Great Lakes Datum of 1985. NATIONAL WILDLIFE REFUGE: Ottawa NWRCOOPERATION:
  USGS Great Lakes Science Center REMARKS: Records coded fair for the 2013 calendar
  year. EXTREMES FOR THE PERIOD OF RECORD: Maximum gage height, 573.67 ft, November
  29, 2011; minimum gage height, 568.64 ft, September 24, 2010. EXTREMES FOR CURRENT
  YEAR: Maximum gage height, 572.82 ft, November 1; minimum gage height, 569.46 ft,
  January 1.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
